    false,nt"url": null,nt"notes": "This dataset contains leaf-off 4-band red,
    green, blue, infrared (RGBI) digital orthophoto imagery produced at 50-centimenter
    resolution from new aerial photography captured in the spring of 2013 and spring
    of 2014. The imagery covers most of 29 counties in central and northwestern Minnesota.
    Funding for this data was provided by the Minnesota Natural Heritage Fund, the Minnesota
    Clean Water Legacy Act, and The Environmental and Natural Resources Trust Fund.
